MOTION TO MODIFY SENTENCE - 
The defendant is requesting modification from a straight jail sentence to probation.
The Court grants the motion to modify sentence and vacates the previous sentence imposed on 02-25-15.
The Court now withholds sentence and places the defendant on probation to DOC for one (1) year.
Conditions of probation:
1) spend thirty (30) days in the county jail, under the Huber Law, commencing on 04-26-15 by 5:00 p.m.;
2) maintain fulltime employment or job search;
3) assessment, treatment, counseling as deemed appropriate by the Department's assessment process;
4) complete thirty (30) hours of community service by 07-22-15;
5) letter of apology to the law enforcement officer who made the arrest;
6) pay superviison fees in an amont to be determined by DOC;
7) pay court costs.
Minutes.
